            <Cabecalho titulo="Sistema Hoteleiro"/>
            <Menu/>
            <div>
                {props.children}
            </div>
            <div>
                <Rodape texto="Rua y, 12 - Presidente Prudente/SP"/>
            </div>
        </div>

    )
}
